[advanced]
public IneqMesh GetIneqMesh()
{
    var res = new IneqMesh
    {
        X0 = -1.0,
        Y0 = -1.2,
        Z0 = -1.3,
        X1 = 1.0,
        Y1 = 1.2,
        Z1 = 1.3,
        D = 0.05d,
        Boxed = true,
        IneqTree = 
        	IneqTreeParser.FromFormula(@"(2*x^2+y^2+z^2-1)^3<(0.1*x^2+y^2)*z^3") &
			!(          
              (
                  !IneqTreeParser.FromFormula(@"(2*x^2+y^2+z^2-1)^3<(0.1*x^2+y^2)*z^3 - 0.01") |
                  (!IneqTreeParser.FromFormula(@"(2*x^2+y^2+z^2-1)^3<(0.1*x^2+y^2)*z^3 - 0.05") & (#x+0.065)) |          
                  (!IneqTreeParser.FromFormula(@"(2*x^2+y^2+z^2-1)^3<(0.1*x^2+y^2)*z^3 - 0.09") & (#x+0.125)) |          
                  (!IneqTreeParser.FromFormula(@"(2*x^2+y^2+z^2-1)^3<(0.1*x^2+y^2)*z^3 - 0.13") & (#x+0.185)) |
	              (!IneqTreeParser.FromFormula(@"(2*x^2+y^2+z^2-1)^3<(0.1*x^2+y^2)*z^3 - 0.17") & (#x+0.245)) |
				  (!IneqTreeParser.FromFormula(@"(2*x^2+y^2+z^2-1)^3<(0.1*x^2+y^2)*z^3 - 0.21") & (#x+0.305))                
              )           

              & (#x)
          	)
        
    };
  
	res.PrepareBackgroundMeshBeforeApriory = () => res.RefineTetrahedralMesh(res.IneqTree, 2, 0.02);  
  
  	return res;
}
